import "./App.css";

function App() {
  const users = [
    { name: "Ahmed", age: 20 },
    { name: "Hanad", age: 24 },
    { name: "Najad", age: 26 },
  ];

  return (
    <div className="App">
      {users.map((user, key) => {
        return (
          <div>
            <h1 key={key}> {user.name}, {user.age} </h1>
          </div>
        );
      })}
    </div>
  );
}

export default App;
